import React, { useEffect, useRef, useState } from "react";
import { useNavigate, useParams, useLocation } from "react-router-dom";
import { checkFace } from '../../service/ticketCheck/ticketCheck';
import { Client } from '@stomp/stompjs';
import { SocketMessage } from "../../types/ticketCheck";

const CustomerFaceCheck: React.FC = () => {
    const base64Image = "data:image/webp;base64,";



    const { eventId } = useParams<{ eventId: string }>();
    const location = useLocation();

    const queryParams = new URLSearchParams(location.search);
    const connectId = queryParams.get("connectId");


    const [TEST, setTEST] = useState<File>();

    const [client, setClient] = useState<Client | null>(null)

    const [socketMessage, setSocketMessage] = useState<SocketMessage>();

    //   
    useEffect(() => {
        const stored = localStorage.getItem('ADMIN_STORE');

        if (stored) {
            const obj = JSON.parse(stored);

            if (obj.state.accessToken !== '') {
                const token = obj.state.accessToken

                // WebSocket  
                const connectionOptions = {
                    // brokerURL: 'wss://k10d202.p.ssafy.io/api/ws',
                    brokerURL: 'ws://localhost:9000/ticketing-check/ws',
                    connectHeaders: {
                        Authorization: token
                    }, //    

                    onConnect: () => {
                        newClient.subscribe(
                            `/sub/check/${eventId}/${connectId}`,
                            message => {
                                try {
                                    // JSON  
                                    const parsedMessage: SocketMessage = JSON.parse(message.body);
                                    console.log(parsedMessage)
                                    //  
                                    setSocketMessage(parsedMessage);
                                } catch (error) {
                                    console.error("Failed to parse message or invalid data", error);
                                }


                                // setMessages(prev => [...prev, parsedMessage]);
                            },
                        );
                    },

                    onDisconnect: () => { }
                };
                const newClient = new Client();

                newClient.configure(connectionOptions);

                //   
                newClient.activate();
                setClient(newClient);
                return () => {
                    newClient.deactivate();
                };
            }
        }
    }, []);


    //  URL   
    const dataUrlToFile = (url: string, fileName: string) => {
        const image_data = atob(url.split(',')[1]); // data:image/gif;base64  , base64  

        const arraybuffer = new ArrayBuffer(image_data.length);
        const view = new Uint8Array(arraybuffer);

        for (let i = 0; i < image_data.length; i++) {
            view[i] = image_data.charCodeAt(i) & 0xff;
        }

        const blob = new Blob([arraybuffer], { type: "image/png" }); // Blob  
        const file = new File([blob], fileName, {
            type: "image/png",
            lastModified: Date.now(),
        });

        return file;
    };

    //    
    const sendImageToServer = async () => {
        try {
            // Base64     ( )
            const fff = dataUrlToFile(base64Image, "image.png");

            //  POST 
            const response = await checkFace(fff, eventId, connectId);
            console.log(response);
        } catch (error: any) {
            alert(error.message);
        }
    };

    //   
    const downloadImage = () => {
        const link = document.createElement('a');
        link.href = base64Image;
        link.download = 'customer-face.png';
        document.body.appendChild(link);
        link.click();
        document.body.removeChild(link);
    };

    return (
        <div className='flex'>
            <button className='border border-black' onClick={sendImageToServer}>Upload Image</button>
            <img src={base64Image} alt="Face Image" />
            <img src={socketMessage?.data.faceImg} alt="" />
        </div>

    );
};

export default CustomerFaceCheck;
